\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\ri-1940\slleading-400\pardirnatural

\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
Performing a "flick-left" gesture on a list item to delete it seems to be a pretty common convention, and it's nice in a lot of ways (doesn't take up screen space until it's needed). However, it does smack a little of "Mystery Meat" design because nothing is displayed on screen which helps you understand how to delete that list item (in this case, a Group), until you perform a gesture. This could effectively render this functionality invisible for any User that doesn't know the convention. Can we mitigate this somehow? P.S. a "Walkthrough" or "Hints" displayed in the UI should be a last resort in my opinion\'85not ruling this out, but if a User has to consult "Help" to work out how to do something, especially in an App which is fundamentally quite basic, then perhaps that should tell us that our design isn't quite right? (playing "Devil's Advocate" here\'85)}

