Might people be worried that deleting a Group will also delete all the Contacts in it? This concern is valid for all the Ideas in this ISN, I think. In the confirmation dialog (Contact Sheet / Message Box etc) we can explain that this isn't the case, but is there a way to make this clearer or more obvious from the get go, so that Users don't experience that "friction" / moment of uncertainty BEFORE they tap the Delete button?}

