1.3 Group Edit Screen - Idea A}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red76\green76\blue76;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\ri-1940\slleading-400\pardirnatural

\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
In Apple's standard iOS Contacts app, you can only delete a Contact after going into "Edit Mode", after which a red "Delete Contact" button is displayed at the bottom of the scrollable screen of Contact info. I know we're talking Group deletion here and not Contacts, but I quite like this design and think it might be a good fit for deleting Groups from Zone, too. I like the design because it makes an irreversible action that little bit more difficult to do, which is a good thing. What I don't like about it is that you can't see how to delete before you put the app into "Edit Mode". }

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
